def do_algebra(operator, operand):
    """
    Given two lists operator, and operand. 
    The first list has basic algebra operations, and 
    the second list is a list of integers. 
    Use the two given lists to build the algebric expression and return the evaluation of this expression.
    The basic algebra operations:
    Addition ( + )
    Subtraction ( - )
    Multiplication ( * )
    Floor division ( // )
    Exponentiation ( ** )
    """
    if len(operator) != len(operand) - 1:
        raise ValueError("Length of operator list must be equal to length of operand list minus one")
    if not all(isinstance(x, int) for x in operand):
        raise ValueError("All elements in operand must be non-negative integers")
    if not all(isinstance(x, str) for x in operator):
        raise ValueError("All elements in operator must be a valid algebra operation")

    expression = str(operand[0])
    for oprt, oprn in zip(operator, operand[1:]):
        if oprt == "+":
            expression += "+" + str(oprn)
        elif oprt == "-":
            expression += "-" + str(oprn)
        elif oprt == "*":
            expression += "*" + str(oprn)
        elif oprt == "//":
            expression += "//" + str(oprn)
        elif oprt == "**":
            expression += "**" + str(oprn)
        else:
            raise ValueError("Invalid algebra operation")

    result = eval(expression)
    return result
